import React, { useState } from "react";
import SearchBar from "./SearchBar";
import { GoogleMap, Marker, useJsApiLoader } from "@react-google-maps/api";
import BookingModal from "./BookingModal";

const mapContainerStyle = { width: "100%", height: "400px" };
const center = { lat: 40.7128, lng: -74.006 }; // Default (NYC)

const PublicMapView = () => {
    const { isLoaded } = useJsApiLoader({ googleMapsApiKey: "AIzaSyDGBHVURcrUdjYNhCDNjFBWawsv612pQU0" });
    const [offices, setOffices] = useState([]);
    const [selectedOffice, setSelectedOffice] = useState(null);

    return (
        <div style={styles.container}>
            <h2>Find a Dentist Near You</h2>
            <SearchBar setOffices={setOffices} />

            <div style={styles.content}>
                {/* üìå Office List */}
                <ul style={styles.list}>
                    {offices.map((office, index) => (
                        <li key={index} style={styles.office} onClick={() => setSelectedOffice(office)}>
                            <strong>{office.name}</strong>
                            <p>Available Slots: {office.availableSlots.join(", ")}</p>
                        </li>
                    ))}
                </ul>

                {/* üìç Google Map */}
                {isLoaded && (
                    <GoogleMap mapContainerStyle={mapContainerStyle} center={center} zoom={12}>
                        {offices.map((office, index) => (
                            <Marker key={index} position={office.location} onClick={() => setSelectedOffice(office)} />
                        ))}
                    </GoogleMap>
                )}
            </div>

            {/* Booking Modal */}
            {selectedOffice && <BookingModal office={selectedOffice} onClose={() => setSelectedOffice(null)} />}
        </div>
    );
};

const styles = {
    container: { padding: "20px" },
    content: { display: "flex", gap: "20px" },
    list: { listStyleType: "none", padding: 0, width: "30%" },
    office: { padding: "10px", background: "#f8f8f8", cursor: "pointer", borderRadius: "5px", marginBottom: "10px" }
};

export default PublicMapView;
